import kleLogo from "../src/assets/images/KLE_Logo.jpeg"
import Navbar from "./Navbar";

function Header(){
    return <div className="header">
        <img id="kleLogo" src={kleLogo} height="80"/>
        <h1>KLE Staff</h1>
     </div>
};

export default Header;
